'use strict';

module.exports = function (t, a) {
	var el;
	t = t.call;

	el = document.createNode();
	el.name = 'parent';
	el.appendChild(document.createNode()).name = 'first';
	el.appendChild(document.createNode()).name = 'second';

	a(t(el), el, "Returns self");
	a(el.firstChild, null);
	t(el);
	a(el.firstChild, null, "Empty already empty");
};
